●コンセント部は回転せずに、巻き取り部のみの回転が可能です！<br><br>

●工具を差したまま電線の巻き取り引き出しが出来ます。<br><br>

●回転運動をしながら給電を簡単に行えるスリップリング方式です。<br><br>

●ドラムを寝かせても、電線を引き出せます！<br><br>

【マジックリールのメリット】<br>
・コンセントパネルが背面の為、工具のコードを差したままコードの引き出し<br>
巻き取りができます！<br>
・電線がヨジれず、絡みません。<br>
・工具の電線同士が干渉しないため、キズが付きにくいです。<br>
・プラグの抜き差しが少ないため、刃受けのガタつきが激減します。<br>
・刃受けのガタつきによる接触不良がなく熱の発生が少ないです。<br><br>


【長さ】：30m<br>
【電線仕様】：VCT 2.0×3<br>
【電線許容電流】：22A<br>
【コンセント数】：4<br>
【重量】：6.7kg<br><br>

≪ 一覧 ≫ <br><br>
マジックコードリール 100Ｖ 30m アース付 過負荷漏電保護: Z-EK34 <br><br>
マジックコードリール 100Ｖ 30m アース付 漏電保護用: Z-EB34 <br><br>
マジックコードリール 100Ｖ 30m アース付 : Z-E34 <br><br>
マジックコードリール 100Ｖ 30m アース無 : Z-304D <br><br>

