全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)詰替式スプレー缶<br>
ECO商品<br>
タンク容量650cc<br>
<br>
ステンレスタンクで長期間使用できます<br>
充填剤を変える事でパーツクリーナー・潤滑剤等に使用できます<br>
エアーのみでエアーダスターとしても使用できます<br>
充填作業は簡単な2工程だけ<br>
液剤を入れて圧縮エアーを充填するだけ<br>
細口ノズル採用で狭いスペースにも使用可能<br>
タイヤバルブ採用なので圧縮エアー充填は簡単にできます<br>
<br>
解放値：630kPa<br>
